import React from "react";
import { useState } from "react";
import AdminModal from "../AdminModal/AdminModal";
import "./Brand.scss";
import { Form, Table } from "react-bootstrap";

const Brands = () => {
  const [brandModal, setBrandModal] = useState(false);
  const handleShowModal = () => {
    setBrandModal(true);
  };

  return (
    <div className="admin-brands">
      <div className="admin-brands-page">
        <div className="admin-brands-wrapper">
          <AdminModal
            show={brandModal}
            onHide={() => setBrandModal(false)}
          ></AdminModal>
          <div className="brands-title">
            <h2>Brands</h2>
          </div>
          <div className="brands-content">
            <button onClick={handleShowModal}>
              <i class="bx bx-plus"></i>Create brands{" "}
            </button>
          </div>
        </div>
        <Table className="my-5">
          <thead>
            <tr>
              <th>#</th>
              <th>Name</th>
              <th>Logo</th>
              <th>Status</th>
              <th>Action</th>
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>1</td>
              <td>Apple</td>
              <td><img style={{width : '40px', height : '40px', object}} src="https://media.designrush.com/inspiration_images/134802/conversions/_1511456315_653_apple-preview.jpg" alt="" />
              </td>
              <td>
              <Form>
                <Form.Check 
                  type="switch"
                  id="custom-switch"
                  label="Publish"
                />
                </Form>
              </td>
            </tr>
          </tbody>
        </Table>
      </div>
    </div>
  );
};

export default Brands;
